// --------------------------------------
// Reset
void BinnedSkyMap::reset()
{
  for(unsigned ni = 0; ni < Nx_*Ny_; ni++)
    { 
      intensity_.assign(ni,0);
      countrate_.assign(ni,0);
      // sources_ = Gaussian();
    }
}
